import React from 'react';
import {Redirect} from 'react-router-dom';
import {FuseUtils} from '@fuse';
import {ExampleConfig} from 'app/main/example/ExampleConfig';
import { MailConfirmPageConfig } from 'app/main/mail-confirm/MailConfirmPageConfig';
import { LoginPageConfig } from 'app/main/login/LoginPageConfig';
import {ForgotPasswordPageConfig } from 'app/main/forgot-password/ForgotPasswordPageConfig';
import { RegisterPageConfig } from 'app/main/register/RegisterPageConfig';
import { ResetPasswordPageConfig } from 'app/main/reset-password/ResetPasswordPageConfig';
import { LockPageConfig } from 'app/main/lock/LockPageConfig';
import {ProfilePageConfig} from 'app/main/profile/ProfilePageConfig';
import {FeedPageConfig} from 'app/main/feed/FeedPageConfig'
import {AcademyAppConfig} from 'app/main/academy/AcademyAppConfig'
//import {ProjectDashboardAppConfig} from 'app/main/dashboards/project/ProjectDashboardAppConfig';
const routeConfigs = [
    ExampleConfig,
    RegisterPageConfig,
    LoginPageConfig, 
    ForgotPasswordPageConfig, 
    LockPageConfig,
    MailConfirmPageConfig,
    ResetPasswordPageConfig, 
    ProfilePageConfig, 
    FeedPageConfig,
    AcademyAppConfig, 
    // ProjectDashboardAppConfig

];

const routes = [
    ...FuseUtils.generateRoutesFromConfigs(routeConfigs),
    {
        path     : '/',
        component: () => <Redirect to="/example/"/>
    }
];

export default routes;
